import './App.css';
import Home from './Home';

function App() {
  return (
    <div className="app">
      <header className="header">
        <h1>Home</h1>
        <button className="login-button">Login</button>
      </header>
      <div className="main-content">
        <main className="content">
          <Home />
        </main>
      </div>
      <footer className="footer">
        <p>&copy; 2024 My App. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
